import React, { useState } from 'react';
import app from './firebase'; // Import the Firebase configuration
import { getAuth, signInWithEmailAndPassword } from 'firebase/auth';
import logo from '../images/logo.png'

const Login = () => {

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = async () => {
    const auth = getAuth(app);

    try {
      // Authenticate the user using Firebase Authentication
      await signInWithEmailAndPassword(auth, email, password);

      // Once authenticated, you can redirect or perform other actions
      console.log('Authentication successful');
    } catch (error) {
      console.error('Authentication failed:', error.message);
    }
  };


  return (
    <>
   <div className="conatiner-fluid" style={{marginBottom:"300px"}}>
    <div className="row p-0 m-0">
        <img className='m-5' style={{width:"150px",height:"100px"}} src={logo} alt="" />
    </div>
    <div className="row   text-center p-0 m-0">
        <div className="form p-5 mx-auto" style={{width:"max-content",backgroundColor:"#161617",borderRadius:"30px"}} >
            <h4 className='text-white'>Administraion Login</h4>
            <form action="">
                <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} className='rounded-pill  px-4 py-2 my-2 mt-5 bg-dark text-white ' style={{width:"300px", border:"1px solid white"}} placeholder='Email' /><br />
                <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} className='rounded-pill px-4 py-2 my-2 bg-dark text-white ' style={{width:"300px",border:"1px solid white"}} placeholder='Password' /><br />
                <button className='btn rounded-pill px-5 mt-2 mb-3 '  onClick={handleLogin} style={{backgroundColor:"black",color:"white"}}>Log In</button>
            </form>
        </div>
    </div>
    
   </div>
    </>
  )
}

export default Login
